import './App.css';
import "./css/main.css";
import "./css/custom.css";
import "./utill.css";
import "./util.min.css";

function App() {
  return (
    <div classNameNameName="App">
      <header classNameNameName="App-header">

      <div classNameName="container-menu-desktop">



    <div classNameName="topbar">
      <div classNameName="content-topbar container h-100">
        <div classNameName="logo" style={{paddingTop:'20px', paddingBottom:'20px'}}> <a href="index.html"><img src="images/news-logo.png" alt="LOGO"/></a> </div>
        <div id="date" style={{position:'relative' , left:'-200px'}}></div>

    <select name="Location" id="location" form="carform" style={{border:"#fff"}}>

      <option value="volvo">Hyderabad</option>
      <option value="saab">Mumbai</option>
      <option value="opel">Bangalore</option>
      <option value="audi">Delhi</option>
    </select> </div>
      </div>
    </div>



    <div className="wrap-header-mobile"> 

      <div className="logo-mobile"> <a href="index.html"><img src="images/icons/logo-01.png" alt="IMG-LOGO"/></a> </div>


      <div className="btn-show-menu-mobile hamburger hamburger--squeeze m-r--8"> <span className="hamburger-box"> <span className="hamburger-inner"></span> </span> </div>
    </div>

      </header>
    </div>
  );
}

export default App;
